INSERT INTO eZArticle_Article VALUES(1,'eZ article tag demo',replace(replace('<?xml version="1.0"?><article><generator>qdom</generator>\n<intro>This article is a demontration of some of the features of the eZ publish? article renderer engine.</intro><body><page><factbox><header level="3">This is a factbox</header>\r\neZ publish supports:\r\n<bullet>\r\nXML based articles\r\nTemplate based tags\r\nUser defined article tags\r\nArticle caching</bullet>\r\n\r\nIn an article you can place:\r\n<list>\r\nFormatted text\r\nImages\r\nFiles\r\nFeedback forms\r\nVideo, Flash and other media types</list>\r\n<image id="4" align="center" size="small" />\r\n<link href="ezcommunity.net" text="ezcommunity.net" />\r\n</factbox>\r\n<header level="1">Basic tags</header>\r\nYou can of course use tags like <bold>bold</bold>, <italic>italic</italic>, <underline>underline</underline>, <strike>strike</strike> and <strong>strong</strong>.\r\n\r\nThere is also the basic navigation tags like <link href="ez.no" text="link to ez.no" />.  If you want to send an e-mail <mail to="spam@nospam.com" subject="this is the subject" text="click to send it" />.\r\n\r\n<bold>Note:</bold> All these tags can be customized with a template.\r\n\r\n<header level="1">Image alignment in text</header>\r\nLorem ipsum dolor sit amet,consectetaur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla\r\n pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum Et harumd und lookum like Greek to me, dereud facilis est er expedit distinct\r\n\r\n<image id="3" align="left" size="medium" href="ezcommunity.net" />Lorem ipsum dolor sit amet, consectetaur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqu